import styleUtils from '../styles/utils.module.css';


const Alphabet: React.FC = () => {
  const alphabet = Array.from(Array(26), (_, i) => String.fromCharCode(65 + i)); // Generate an array of alphabet characters

  return (
    <div className={styleUtils.alphabet}>
      {alphabet.map((char) => (
        <button key={char} className={styleUtils.alphabetButton} onClick={disabl}>
          {char}
        </button>
      ))}
    </div>
  );
};

export default Alphabet;
